import React from 'react'
import './Header.css'
function Header() {
    return (
        <div className="Header">
            <img src="http://pngimg.com/uploads/amazon/amazon_PNG11.png" alt="" />
            <div className="header_search">
                <input type="text"/>

            </div>
        </div>
    )
}

export default Header
